import './App.css';
import Navbars from './components/Navbars';
import Ussection from './components/Ussection';
import Healthysection from './components/Healthy section';
import Trainerssection from './components/Trainerssection';
import Iconsection from './components/Iconsection';
import Footer from './components/Footer';
import { BrowserRouter,Routes,Route,Link } from 'react-router-dom';
function App() {
  return (
   <div>
    <BrowserRouter>


    <Link className='px-2' to="/">home</Link>
    <Link className='px-2'  to="/about">Ussection</Link>
    <Link className='px-2' to="/contact">Healthysection</Link>
    <Link className='px-2' to="/service">Trainerssection</Link>
    <Link className='px-2' to="/blog">Iconsection</Link>
    <Link className='px-2' to="/components">Footer</Link>

     <Routes>
      <Route path='/' element={<Navbars/>}></Route>
      <Route path='/about' element={<Ussection />}></Route>
      <Route path='/contact' element={<Healthysection />}></Route>
      <Route path='/service' element={<Trainerssection />}></Route>
      <Route path='/blog' element={<Iconsection />}></Route>
      <Route path='/components' element={<fo />}></Route>
     </Routes>

      <Navbars /> 
      <Ussection />
      <Healthysection />
      <Trainerssection />
      <Iconsection />
      <Footer />

    </BrowserRouter>
    </div>
  );
}

export default App;
